import React from "react";
import Task from "../Task/Task";
const TaskList = ({ tasks, onDeleteItem }) => (
  <ul>
    tasks.map(task => (
    <li key={task.id}>
      <Task onDeleteItem={() => onDeleteItem(task.id)} text={task.text} />
    </li>
    ));
  </ul>
);

export default TaskList;
